Storyline: Directed by Ruben Fleischer, in his feature-length film debut, Zombieland is a Shaun Of The Dead-inspired comedy road movie starring Woody Harrelson and Jesse Eisenberg as two survivors of a zombie apocalypse thrown together in an unlikely but highly amusing partnership. Columbus (Jesse Eisenberg - The Squid And The Whale), with his zombie survival guide in-hand, has only survived this long because he's so afraid of everyone and everything. Tallahassee (Woody Harrelson - 2012) means to take down as many zombies as he can on his obsessional quest for Twinkies. When a chance encounter leads the two to form a partnership, little do they realise it will take them on the post-apocalyptic adventure to end them all. With mischievous female double-act Wichita and Little Rock on the scene and millions of walking dead shuffling the great expanse of the US, things are never dull in Zombieland!


